import React from 'react';
import {Breadcrumb, BreadcrumbItem,Carousel} from 'reactstrap';
import {Link} from 'react-router-dom';
import {baseurl} from '../shared/baseurl';


function Work(props) {

    if(props.work.isLoading){
        return(
            <div className="container">
                <div className="row">
                    LOADING....
                </div>
            </div>
        );
    }
    else if(props.work.errmess){
        return(
            <div className="container">
                <div className="row">
                    {props.errmess}
                </div>
            </div>
        );
    }
    else if(props.work.work){
        const workImg = props.work.work.map((w) => {
            return(
                <div></div>
                             
            );
        })

        return(
            <div className="container">
                <div className="row mt-2">
                    <Breadcrumb>
                        <BreadcrumbItem><Link to="/home">Home</Link></BreadcrumbItem>
                        <BreadcrumbItem active>That's How We Work</BreadcrumbItem>
                    </Breadcrumb>       
                </div>
                <div className="row">
                    <h1 className="siteTextColor">That is how we work</h1>
                </div>
                <div className="row">
                        <UncontrolledCarousel items={props.work.work} />;
                </div>                    
            </div>
        );
    }
    else {
        return(
            <div></div>
        );
    }
}

export default Work;
